  <Layout>
    <NeonLogo />

    <div className='chevron'>
      <Link
        className='test6'
        to='#scroll'
        spy={true}
        smooth={true}
        duration={500}
      >
        {/* <a href={`#${letter}`}>{letter}</a> */}
