          ></path>
        </svg>
        {/* </a> */}
      </Link>
    </div>
    <style jsx>{`
      h1,
      a {
        font-family: 'Arial';
      }

      ul {
        padding: 0;
      }

      li {
        list-style: none;
        margin: 5px 0;
      }

      a {
        text-decoration: none;
        color: blue;
      }

      a:hover {
        opacity: 0.6;
      }

      .chevron {
        margin-bottom: 200px;
        display: flex;
        width: 100%;
        justify-content: center;
        margin-top: 85vh;
      }

      .wrapper {
        margin: 0 auto;
        max-width: 960px;
        padding: 0 2%;
      }
    `}</style>
    <div className='introText' id='scroll'>
      <h2>We play, YOU sing!</h2>
      <p>
        Lorem ipsum, dolor sit amet consectetur adipisicing elit. Hic nostrum ea
