        sapiente facere quod quibusdam itaque impedit! Expedita consequatur cum
        enim cupiditate ratione est fuga sapiente veniam, corporis eius eos
        totam.
      </p>
    </div>
    <style jsx>{`
      .introText {
        font-size: 20px;
        color: white;
      }
    `}</style>
  </Layout>
);

